import React from "react";
import {Link} from "react-router-dom";


class Foo extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      brand: 'Chevy',
      model: 'Malibu',
      color: 'Black',
      license: 'IGX-621',
      year: 2014,
    };
  }
  render() {
    return (
      <div>
        <h1>My Car</h1>
      </div>
       
    );
  }
}
const Aboutpage = () => {
  return (
    <div> 
      <h1>Aboutpage</h1>
      <Link  to='/'>Go to Aboutpage</Link>
    </div>
  )
};

export default Aboutpage;
